import React, { Component } from 'react';

export default class Formulario extends Component {
    render() {
        return (
            <p>
                <label>Dataset de entrenamiento: \t <input type='file' id='dataset1' /></label><br/>
                <label>Dataset para clasificar: <input type='file' id='dataset2' /></label>
            </p>
        );
    }
}
